import React, { useState } from 'react'
import './Organigrama.scss';




export default function Organigrama() {

    const [modal, setModal] = useState(false);

    const openModal = () => {
        setModal(true);
    }
    
    const closeModal = () => {
        setModal(false);
    }

    const handleOk = () => {
        alert('ok');
    }
   
    return (
        <div className="square">
            <h1>Organigrama</h1>
            <Button type="primary" onClick={openModal} >
                Inicio
            </Button>

            <Modal title="Basic Modal" visible={modal} onOk={handleOk} onCancel={closeModal}>
                <p>Some contents...</p>
                <p>Some contents...</p>
                <p>Some contents...</p>
            </Modal>
        </div>
    )
}
